cy.get('@loginInfo').then(response => {
  const decodedObject = JSON.parse(atob(response.body.signInResponsePayload));
  const token = decodedObject.signInUserSession.idToken.jwtToken;
  const salesforceId = decodedObject.signInUserSession.idToken.payload['custom:salesforceId'];
  console.log(token);
  console.log(salesforceId);
  cy.request({
    method: 'GET',
    url: 'https://z8m0fpo6yl.execute-api.us-east-1.amazonaws.com/v1/member/' + salesforceId + '/motivation-of-the-day',
    headers: {
      brand: 'Pack Health',
      authorization: 'Bearer ' + token
    },
    failOnStatusCode: false
  }).as('motdInfo');
  cy.get('@motdInfo').then(response => {
    const responseBodyObjectLength = Object.keys(response.body).length;
    console.log(response);
    expect(response.status).to.equal(200);
    expect(responseBodyObjectLength).to.be.equal(3);
    expect(response.body.success).to.be.a('boolean');
    expect(response.body.errorMessage).to.be.null;
    expect(response.body.motivationOfTheDay).to.be.a('string');
    if (response.body.motivationOfTheDay.includes('3')) {
      expect(response.body.motivationOfTheDay).to.include('MOTD#3: English');
    } else {
      expect(response.body.motivationOfTheDay).to.include('MOTD#5: English');
    }
  });
});
